import './postproperty.css'

function Postproperty() {

    const uploadPropery = () => {
        return true;
    }

    return (
        <>
            <div>
                <form className='form' onSubmit={uploadPropery}>
                    <label className='form-control'>Upload property image</label>
                    <input className='form-control' type='file'></input>
                    <div className='my-2'>
                        <input className='form-control border-0 bg-secondary bg-opacity-25' type='file'
                            name='img' required ></input>
                    </div>
                </form>
            </div>
        </>
    )
}

export default Postproperty;
